    false,nt"url": null,nt"notes": "This annual narrative report for Driftless
    Area National Wildlife Refuge summarizes refuge activities during fiscal year 2001.
     The report begins with an introduction to the refuge and a summary of the yearu2019s
    highlights and climatic conditions.  Information about monitoring and studies- including
    endangered plants and snail populations - is provided next.  Habitat restoration
    and management projects are also covered.  Subjects include upland restoration,
    fire management and pest plant control. Fish and wildlife management is next, although
    there was nothing to report. Coordination activities, such as agency partnerships
    and private land activities are outlined.  The resource protection section provides
    information about law enforcement and land acquisition.  Information about public
    education and recreation is given including visitor services and outreach programs.
     Finally, refuge planning and administration are discussed.",nt"owner_org":
